"}},{"id":"0717194731","name":"Grace Christian School Of Pasco","rating":null,"slug_id":"Grace-Christian-School-Of-Pasco-0717194731","location":{"city":"Hudson","state":"FL","city_slug_id":"Hudson_FL"}}],"total":48},"university":[{"lid":"00000001104484410392","name":"Saint Leo University","slug_id":"Saint-Leo-University-00000001104484410392","city":"St. Leo","city_slug_id":"St.-Leo_FL","state_code":"FL"},{"lid":"00000001105083063466","name":"Pasco Hernando Community College West Campus","slug_id":"Pasco-Hernando-Community-College-West-Campus-00000001105083063466","city":"New Port Richey","city_slug_id":"New-Port-Richey_FL","state_code":"FL"},{"lid":"00000001104484411217","name":"Trinity College of Florida","slug_id":"Trinity-College-Of-Florida-00000001104484411217","city":"Trinity","city_slug_id":"Trinity_FL","state_code":"FL"}],"district":{"districts":[{"id":"06160000721","name":"Pasco","rating":null,"slug_id":"Pasco-06160000721","location":{"city":"LAND O LAKES","state":"FL","city_slug_id":"LAND-O-LAKES_FL"}}],"total":1},"status_code":200},"articles":[{"post_id":"95877","canonical":"https://www.realtor.com/advice/rent/how-often-can-my-landlord-show-my-apartment-2/","seo_url":"/advice/rent/how-often-can-my-landlord-show-my-apartment-2/","title":"Notice of Entry, and Other Rules Your Landlord Needs to Follow","status":"publish","body":"\u003cp\u003eWith a rental lease set to expire, most landlords want to show the apartment as often as possible, which means they\'ll need a notice of entry to get into your place. They\'ll be eager to find new renters, but the law states they can\'t just unlock your door at any time and pop in for a visit. They also aren\'t allowed to show the apartment so many times that it creates a nuisance for you and disrupts your life.\u003c/p\u003e\n\u003cp\u003eIf you\'re a renter, read on for the rules of landlord entry, so you know what to expect.\u003c/p\u003e\n\u003ch2 id=\"landlord-notice-of-entry\"\u003eLandlord notice of entry\u003c/h2\u003e\n\u003cp\u003eLandlords are legally obligated to provide a renter with notice that they\'ll be entering the premises—for \u003cem\u003eany\u003c/em\u003e reason. Whether that\'s to show the property to a potential renter or to fix a leaky faucet, the law is clear: Legal tenants have the right to quiet enjoyment of their home.\u003c/p\u003e\n\u003cp\u003e\"The landlord must provide reasonable notice in writing (generally, 24 hours) of his intent to enter—and to do it only during normal business hours,\" explains \u003cstrong\u003eBryan Zuetel\u003c/strong\u003e, a Realtor® and real estate attorney from Irvine, CA. If a tenant is home and consents to entry, the 24-hour notice can be waived. Then again, it is OK for a tenant to deny entry to their landlord if they show up unannounced.\u003c/p\u003e\n\u003cp\u003eIf the landlord intends to rent or sell the property to someone new, they may ask you to allow additional showings, Zuetel says. And depending on what\'s spelled out in your lease agreement, you may have to comply. \"For example, under certain conditions, a landlord may require that the tenant permit a weekend open house during regular business hours, and the landlord may provide oral notice of entry to the tenant,\" he says.\u003c/p\u003e\n\u003cp\u003eSo pull out the paperwork you signed if you\'re worried that your landlord is crossing the line. Landlords who are following those guidelines are probably in the clear.\u003c/p\u003e\n\u003ch2 id=\"how-often-can-a-landlord-show-an-apartment\"\u003eHow often can a landlord show an apartment?\u003c/h2\u003e\n\u003cp\u003eRental law does not specifically stipulate a maximum number of times a landlord is allowed to show an apartment to prospective tenants. It does, however, provide some cover for tenants. \"The landlord may not abuse the right of access, or use it to harass the tenant,\" Zuetel explains.\u003c/p\u003e\n\u003cp\u003eThat might sound vague, but if you do feel like your landlord is abusing the right of access and bothering you too often, you should try talking to them first, before calling an attorney. \"Let them know that you are feeling stressed from all the showings and ask for a break for a few days—that seems more than reasonable,\" says \u003cstrong\u003eHolly Pasut\u003c/strong\u003e, a Realtor with Hines and Associates Realty in Cornelius, NC. If that doesn\'t help, you can then seek legal action.\u003c/p\u003e\n\u003cp\u003eHere\'s more on the rights of tenants who find out their \u003ca href=\"https://www.realtor.com/advice/rent/my-landlord-is-selling/\" target=\"_blank\" rel=\"noopener noreferrer\"\u003elandlord is selling their house\u003c/a\u003e.\u003c/p\u003e\n","modified":"2022-08-18T00:47:28+00:00","published":"2022-08-16T11:00:53+00:00","slug":"how-often-can-my-landlord-show-my-apartment-2","excerpt":"Q: How often can my landlord show our apartment? While we get 24 hour notice, and it is between 8 and 5, it has been shown more than 25 times in the last month and a half. This past week has had showings every day. I heard about the \"quiet enjoyment\" law, and was wondering if this is a proper time t","author":{"ID":467,"name":"Jeanne Sager","slug":"jsager","description":"Jeanne Sager has strung words together for the New York Times, Vice, and more. She writes and photographs people from her home in upstate New York.","twitter_contact":"JeanneSager","display_name":"Jeanne Sager"},"category":{"name":"Rent","parent":"Advice"},"featured_image":{"source_thumbnail_retina":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w290_h164_r4_q80.jpg","source_mobile":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w300_h300_r4_q80.jpg","source_thumbnail":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w145_h81_r4_q80.jpg","alt_text":"knocking-on-door","source_desktop":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w628_h354_r4_q80.jpg","source_mobile_retina":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w506_h284_r4_q80.jpg","source_ngi":"http://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0xd-w640_h480_q80.jpg","ID":"399013","source_desktop_retina":"https://na.rdcpix.com/1060405474/d6e5a494151545c7094de494ed374685w-c0rd-w1024_h1024_r4_q80.jpg","credit":"KatarzynaBialasiewicz/iStock","type":"image"},"tags":["apartment","landlord-tenant problems","moving","rentals","renting","updates"],"seo_focus":"notice of entry","seo_title":"Notice of Entry and Other Rules Your Landlord Needs to Follow","seo_desc":"Landlords may be eager to find new renters, but they can\'t just unlock your door at any time and pop in for a visit—they need a notice of entry.","attribution":null,"created":"2016-08-30T21:09:55.244Z","sponsored_content":"false","related":[{"img_src_retina":"https://na.rdcpix.com/020f697d45c56108aada5682259c7415w-c3223642232rd-w506_h284_r4_q80.jpg","seo_url":"/advice/buy/phrases-home-buyers-should-never-include-in-offer-letter/","post_id":"502807","attribution":{},"img_alt":"These Phrases Could Doom Your Offer Letter","title":"6 Fatal Phrases Home Buyers Should Never Include in Their Offer Letter—Ever","img_src":"https://na.rdcpix.com/020f697d45c56108aada5682259c7415w-c3223642232rd-w300_h300_r4_q80.jpg"},{"img_src_retina":"https://na.rdcpix.com/811cb7f4c2e954ea521cbdec9e120da8w-c2996724006rd-w506_h284_r4_q80.jpg","seo_url":"/advice/buy/things-to-do-before-making-an-offer-on-a-house/","post_id":"571018","attribution":{},"img_alt":"found-the-one-01","title":"Found The One? 10 Things To Do Before Making an Offer on a House","img_src":"https://na.rdcpix.com/811cb7f4c2e954ea521cbdec9e120da8w-c2996724006rd-w300_h300_r4_q80.jpg"},{"img_src_retina":"https://na.rdcpix.com/5d80e6bf30c7fb4f6fc8b160e5f95842w-c4234753987rd-w506_h284_r4_q80.jpg","seo_url":"/advice/sell/real-estate-commission-explained/","post_id":"197841","attribution":{},"img_alt":"realtor-fees-commission-v2","title":"The Real Estate Commission: How Much Are Realtor Fees?","img_src":"https://na.rdcpix.com/5d80e6bf30c7fb4f6fc8b160e5f95842w-c4234753987rd-w300_h300_r4_q80.jpg"}],"tags_internal":["SEO"],"pie_chart_details":{"data":null,"title":""},"hide_mid_ad":"No","bar_chart_details":{"data":null,"title":""},"hide_viglink":"Yes","location_details":null,"hide_publish_date":"No","tag_details":[{"name":"apartment","id":7699,"slug":"apartment"},{"name":"landlord-tenant problems","id":2463,"slug":"landlord-tenant-problems"},{"name":"moving","id":3030,"slug":"moving"},{"name":"rentals","id":3794,"slug":"rentals"},{"name":"renting","id":3799,"slug":"renting"},{"name":"updates","id":12061,"slug":"updates"}],"image_gallery_data":[{"img_url":null,"caption":null,"credit":null}],"map_details":"MAP DATA NOT AVAILABLEArray Count","exclude_in_rss_feed":true,"delay_in_rss_feeds":"2022-08-16T11:00:53+00:00"},{"post_id":"97938","canonical":"https://www.realtor.com/advice/rent/how-much-will-it-cost-me-to-rent-my-house-through-a-realtor/","seo_url":"/advice/rent/how-much-will-it-cost-me-to-rent-my-house-through-a-realtor/","title":"The Cost of Hiring a Real Estate Agent to Rent Out Your Home","status":"publish","body":"\u003cp\u003eMany home owners don\'t think they need help when it comes to renting out their spaces. They simply put a \"for rent\" sign in the front yard and post their property online with other \u003ca href=\"https://www.realtor.com/rentals\" target=\"_blank\" rel=\"noopener noreferrer\"\u003ehomes for rent\u003c/a\u003e, hoping it will all work out. But not every homeowner can, or should, go it alone.\u003c/p\u003e\n\u003cp\u003eHiring a \u003ca href=\"https://www.realtor.com/agentconnection/\" target=\"_blank\" rel=\"noopener noreferrer\"\u003ereal estate agent\u003c/a\u003e to handle the logistics of renting out your property can be a smart move—one that many homeowners make. An agent can create a listing for you, help you check out applicants, and generally manage other aspects of renting so you don\'t have to. But before you sign a contract with an agent, you\'ll want to figure out how much it will cost so you still come out ahead. Do the math!\u003c/p\u003e\n\u003cp\u003eLet\'s take a look at how much it costs to rent out your home through an agent.\u003c/p\u003e\n\u003ch2 id=\"real-estate-agent-fees-associated-with-rentals\"\u003eReal estate agent fees associated with rentals\u003c/h2\u003e\n\u003cp\u003eThe amount your agent will charge you depends on the list of responsibilities and the rate they plan on charging you.\u003c/p\u003e\n\u003cp\u003e“There is no set commission,” says \u003cstrong\u003eBeverley Hourlier\u003c/strong\u003e, a Realtor® with Hilltop Chateau Realty in San Diego. But there are some common guidelines.\u003c/p\u003e\n\u003cp\u003e“I usually charge half of the monthly rent if I am just helping to lease,” Hourlier says. She adds that some agents charge a “lease up” fee, which is half the rent plus costs like running a credit report, plus a property management fee.\u003c/p\u003e\n\u003cp\u003e“If I property manage, then I charge 10% of the monthly lease,” Hourlier says. Keep in mind, property management is a little outside the wheelhouse of most real estate agents. If that\'s what you\'re looking for, you might want to hire a company separately. Some property management companies will find your tenant for an additional fee.\u003c/p\u003e\n\u003cp\u003eAlthough there isn\'t a set commission for real estate agents involved in \u003ca href=\"https://www.realtor.com/rentals\" data-internallinksmanager029f6b8e52c=\"7\" title=\"rentals to SRP\" target=\"_blank\" rel=\"noopener\"\u003erentals\u003c/a\u003e, a common range is around the cost of one month\'s rent.\u003c/p\u003e\n\u003cp\u003e“My charge to all of my rental clients is one month’s rent, which will be split between my broker and the renting broker,” says \u003cstrong\u003eJuan Vazquez\u003c/strong\u003e, a real estate agent with RSVP Homes Realty in Hollywood_FL.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eJohn Klein\u003c/strong\u003e, a real estate agent in Coral Springs_FL, also says a commission of 10% of the monthly lease or one month’s rent is standard.\u003c/p\u003e\n\u003cp\u003eWith those ballpark figures in mind, make sure you and your real estate agent make a list of services they\'ll provide to get your home rented out. That way you\'ll know what their fees cover. If an experienced agent can bring you a responsible renter who can pay more, it could be well worth the fee.\u003c/p\u003e\n","modified":"2022-08-18T02:47:47+00:00","published":"2022-08-16T11:00:09+00:00","slug":"how-much-will-it-cost-me-to-rent-my-house-through-a-realtor","excerpt":"Q: How much will it cost me to hire a Realtor to list my house for rent online. Thanks.\r\n\r\n--TJ, Weston_FL\r\n\r\nA: Hi. My charge to all of my rental clients is one month rent which will be split between my broker and the renting broker. I also live in Weston.\r\nJuan Vazquez is a Realtor® with RSVP Ho","author":{"ID":425,"name":"Adriana Velez","slug":"avelez","description":"Adriana Velez is a food, wellness, and home writer. Her work has been featured in Healthyish, Prevention.com, Lifehacker, She Knows, and CafeMom.","twitter_contact":"","display_name":"Adriana Velez"},"category":{"name":"Rent","parent":"Advice"},"featured_image":{"ID":"750755","source_mobile":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf13b9w-c729576591rd-w300_h300_r4_q80.jpg","source_mobile_retina":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf13b9w-c729576591rd-w506_h284_r4_q80.jpg","source_desktop":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf13b9w-c729576591rd-w628_h354_r4_q80.jpg","source_desktop_retina":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf13b9w-c729576591rd-w1024_h1024_r4_q80.jpg","source_thumbnail_retina":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf13b9w-c729576591rd-w290_h164_r4_q80.jpg","source_thumbnail":"https://na.rdcpix.com/a1790d2911110f8ee0d9be742bcf